import './Modal.css';
import ModalStand from './ModalStand';

const Modal = () => {
    return (
        <div className="modalWrapper">
            <div className="modalInnerWrapper">
                <div className="titleWrapper"></div>
                <ModalStand></ModalStand>
                <ModalStand></ModalStand>
                <ModalStand></ModalStand>
                <ModalStand></ModalStand>
            </div>
        </div>
    );
}

export default Modal;
